import React from 'react';
import Home from './Home';
import ApplyLoanStepper from './ApplyLoanStepper';

type ContentContainerProps = {
  selectedMenu: number;
  goToTab: (tab: number) => void;
};

const ContentContainer: React.FC<ContentContainerProps> = React.memo(({selectedMenu, goToTab}) => {

  const getComponentToLoad = React.useMemo(() => {
    switch(selectedMenu) {
      case 1: return <Home goToTab={goToTab} />;
      case 2: return <ApplyLoanStepper goToTab={goToTab}/>
      default: return <Home goToTab={goToTab} />
    }
  })

  return (
    <div>
      <div className="sidebar-content">{getComponentToLoad()}</div>
    </div>
  );
});

export default ContentContainer;
